import React from 'react';

export default function App() {
  return (
    <div
      style={{
        minHeight: '100vh',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'flex-start',
        background: 'linear-gradient(135deg, #2196f3 0%, #0d47a1 100%)',
        paddingTop: '10vh',
      }}
    >
      <h1
        style={{
          color: '#FFD600',
          fontSize: '4rem',
          fontWeight: 'bold',
          textShadow: '2px 2px 8px #000',
          letterSpacing: '2px',
          marginBottom: '5rem',
        }}
      >
        British Open Golf
      </h1>
      <a
        href="#"
        style={{
          background: '#FFD600',
          color: '#0d47a1',
          fontWeight: 'bold',
          fontSize: '1.5rem',
          padding: '0.75rem 2.5rem',
          borderRadius: '2rem',
          textDecoration: 'none',
          boxShadow: '0 4px 16px rgba(33,150,243,0.2)',
          transition: 'background 0.2s, color 0.2s',
        }}
        onMouseOver={e => {
          e.target.style.background = '#fff';
          e.target.style.color = '#0d47a1';
        }}
        onMouseOut={e => {
          e.target.style.background = '#FFD600';
          e.target.style.color = '#0d47a1';
        }}
      >
        Join Now
      </a>
    </div>
  );
}
